    content: [`Venom là một phim siêu anh hùng của Mỹ dựa trên nhân vật cùng tên của Marvel Comics, do Columbia Pictures sản xuất và Sony Pictures Releasing phát hành. Nó được dự định là bộ phim đầu tiên trong Thế giới Marvel của Sony, được hỗ trợ nhưng tách biệt khỏi Vũ trụ Điện ảnh Marvel (MCU).[a] Đạo diễn phim này là Ruben Fleischer với kịch bản của Scott Rosenberg, Jeff Pinkner, Kelly Marcel và Will Beall, với diễn viên Tom Hardy trong vai Eddie Brock / Venom, cùng với Michelle Williams, và Riz Ahmed. Quá trình phát triển của phim này, một spin-off từ thương hiệu phim Spider-Man, bắt đầu với nhà sản xuất phim Avi Arad năm 2007. Sau nhiều lần lặp lại, công việc tạo một phiên bản mới bắt đầu vào tháng 3 năm 2017 để bắt đầu một vũ trụ được chia sẻ mới với các nhân vật Marvel mà Sony sở hữu quyền làm phim, mặc dù Sony cũng dự định chia sẻ thế giới Người Nhện: Trở về nhà, được đặt trong thế giới MCU sau thỏa thuận giữa Sony và Marvel Studios. Rosenberg và Pinkner đã được giao việc viết kịch bản, với Fleischer và Hardy thêm vào tháng 5 năm 2017. Quá trình quay phim chính bắt đầu vào tháng 10 năm 2017, diễn ra tại Atlanta, New York City, và San Francisco. Venom được dự kiến phát hành tại Hoa Kỳ vào ngày 5 tháng 10 năm 2018. Nhân vật Eddie Brock trong Marvel Comics, nhân vật phản diện chính của Spider-Man, được giới thiệu trong phim ảnh lần đầu tiên với phim Spider-Man 3, với Topher Grace thủ vai. Nhân vật này ban đầu đóng một vai trò nhỏ mà không khám phá cái tôi thay thế Venom, nhưng nhân vật này cuối cùng đã được thay đổi thành một vai phản diện lớn ở phim sau này bởi vì nhà sản xuất Avi Arad cảm thấy chuỗi phim Spiderman đã dựa quá nhiều vào các nhân vật phản diện được đạo diễn Sam Raimi ưa thích thay vì các nhân vật mà các fan hâm mộ hiện đại quan tâm. Raimi đã do dự khi khám phá nhân vật do nó "thiếu nhân tính'". Arad tiết lộ kế hoạch cho một bộ phim spin-off tập trung vào Venom vào tháng 7 năm 2007.`],
