    real_name: 'My Blueberry Nights (2007)',
    content: ['Jeremy (Jude Law) là một thanh niên gốc Manchester, Anh mở một tiệm cà phê nhỏ ở thành phố New York. Tình cờ anh làm quen được với Elizabeth (Norah Jones) trong một lần cô tới quán của Jeremy để tìm người yêu. Không bao lâu sau đó mối tình của Elizabeth tan vỡ, để khuây khỏa cô trò chuyện với Jeremy và được anh mời thưởng thức món bánh việt quất (blueberry) vốn thường xuyên còn thừa sau khi quán đóng cửa. Được một thời gian Elizabeth quyết định rời New York để đi dọc nước Mỹ bằng xe buýt. Cô tới Memphis, Tennessee và làm việc cả sáng lẫn tối tại một tiệm ăn và một quán bar. Elizabeth, nay là Lizzie, có một khách hàng quen thuộc, viên cảnh sát Arnie Copeland (David Strathairn). Nếu như buổi sáng Copeland hoàn toàn tỉnh táo trong vai trò một cảnh sát cần mẫn thì buổi tối tại quán bar nơi Lizzie làm việc, anh lại là một người nghiện rượu và không chịu chấp nhận sự thật rằng vợ anh, Sue Lynne (Rachel Weisz) đã không còn muốn chung sống với mình. Trong một lần đụng độ tại quán bar, Arnie suýt nữa giết chết người yêu mới của Sue Lynne, để trả đũa cô tới quán chửi mắng anh và tuyên bố quan hệ giữa hai người đã hoàn toàn chấm dứt bất kể việc Arnie rút súng ra đe dọa. Tối hôm đó khi quán bar đóng cửa, Arnie tạm biệt Lizzie và chết trong một tai nạn ô tô tại chính nơi anh và Sue Lynne đã gặp gỡ lần đầu. Rời Memphis và đi về phía Tây, Lizzie, nay là Beth, tới làm việc tại một sòng bạc nhỏ ở Nevada. Beth làm quen với Leslie (Natalie Portman), một cô gái trẻ nhưng đã tỏ ra là tay chơi poker sành sỏi. Trong lúc khát tiền để gỡ bạc, Leslie đề nghị Beth cho vay toàn bộ số tiền cô đã dành dụm để mua ô tô với điều kiện là một phần ba số tiền thắng cuộc hoặc chiếc xe Jaguar đời mới của chính Leslie nếu cô thua cuộc. Kết thúc canh bạc, Leslie thông báo với Beth rằng chiếc xe đã thuộc về cô và đề nghị Beth chở mình tới Las Vegas để gặp cha. Khi tới nơi thì cha của Leslie vừa qua đời, Leslie tiết lộ cho Beth rằng thực ra cô đã thắng lớn trong canh bạc cuối và chia cho Beth số tiền cần thiết để mua chiếc xe cô mong ước. Quay trở về Manhattan trên chiếc xe mới, Elizabeth nhận ra người bạn trai cũ đã rời căn hộ trước đây của hai người để sống cuộc sống riêng. Cô tới tiệm cà phê của Jeremy và được anh mời ăn bánh việt quất ở chỗ anh vẫn dành riêng cho Elizabeth kể từ ngày cô rời New York.'],
