    content: ['Phim Tài Xế Taxi dựa trên sự kiện có thật diễn ra vào ngày 18/5/1980, khi đang diễn ra cuộc nổi dậy ở Gwang Ju chống lại chế độ quân sự. Tài xế taxi trung niên Kim Man Seob vẫn mưu sinh bằng nghề lái xe taxi, mỗi ngày lái xe chăm chỉ cũng chỉ đủ ăn. Một ngày nọ, ông nhận được một cuộc gọi đặt taxi với giá 10000 won đi Gwang Ju, một món hời lớn, khách hàng là một phóng viên người Đức. Man Seob vui vẻ lái xe đến đón khách hàng, trải qua chút trắc trở vì không rõ địa hình, lúc ông đưa vị phóng viên đến Gwang Ju cũng là lúc ông nhận ra ở đây dường như đang có bạo động. Man Seob không sợ hãi bỏ về mà tiếp tục vui vẻ cùng vị phóng viên đi quay lại hiện trường, nhưng rào cản ngôn ngữ không cho phép họ tiếp tục làm việc với nhau, ngay lúc ấy xuất hiện cậu bé Koo Jae Sik, người duy nhất có thể nói tiếng anh và giao tiếp với phóng viên. Jae Sik đưa tài xế và phóng viên về nhà mình ăn cơm và kể lại cho họ hình hình hiện nay. Những ngày sau đó, họ tiếp tục hộ tống vị phóng viên hiện trường tác nghiệp mặc cho các cơ quan tình báo đều đang ráo riết đi tìm phòng viên kia và đe dọa sẽ sử dụng vũ lực...    '],
